$(window).on("load",function(){$("#preloader").length&&$("#preloader").delay(100).fadeOut("slow",function(){$(this).remove()})}),$("#countryCodeRun").click(function(){$.ajax({url:"php/getCountryCode.php",type:"POST",dataType:"json",data:{lat:$("#countryCodeLat").val(),long:$("#countryCodeLong").val()},success:function(t){console.log(JSON.stringify(t)),"ok"==t.status.name&&($("#countryCodeResult").html(t.data.countryCode),$("#countryCodeName").html(t.data.countryName))},error:function(t,a,e){}})}),$("#oceanRun").click(function(){$.ajax({url:"php/getOcean.php",type:"POST",dataType:"json",data:{lat:$("#oceanLat").val(),long:$("#oceanLong").val()},success:function(t){console.log(JSON.stringify(t)),"ok"==t.status.name&&$("#oceanResult").html(t.data.name)},error:function(t,a,e){}})}),$("#earthquakesRun").click(function(){$.ajax({url:"php/getEarthquakes.php",type:"POST",dataType:"json",data:{north:$("#earthquakesNorth").val(),south:$("#earthquakesSouth").val(),east:$("#earthquakesEast").val(),west:$("#earthquakesWest").val()},success:function(t){console.log(JSON.stringify(t)),"ok"==t.status.name&&($("#earthquakeDatetime").html(t.data[0].datetime),$("#earthquakeLongitude").html(t.data[0].lng),$("#earthquakeLatitude").html(t.data[0].lat),$("#earthquakeDepth").html(t.data[0].depth),$("#earthquakeMagnitude").html(t.data[0].magnitude))},error:function(t,a,e){}})});